1,article/add,article/add,POST,"*""title"":""Wah, Nenek Moyang Kita Pemburu Kepala"",""description"":""Saya terkaget-kaget saat membaca majalah Historia yang isinya mengungkap sejarah kelam rakyat Nusantara tempo doeloe. Beberapa jurnal juga memuat hal yang sama. Pernah ada sebuah masa, ketika kebiadaban melekat erat jadi tradisi.\r\nMungkin kasus ini jadi alat serang yang menyebut masyarakat primitif memang biadab, karena itulah koloni orang barat (kulit putih) datang merubah masyarakat jadi lebih beradab. Satu sisi yang ada benarnya, walau tidak mutlak. Nyatanya, mereka juga sama biadabnya - dalam bentuk berbeda. Kasus penaklukan Amerika dan Australia, atau kemudian era wild west jadi contoh nyata.\r\nBagaimanapun, sejarah membantu kita belajar dari masa lalu, mengakui kesalahan, lalu mengambil hikmah untuk menjadi lebih baik di hari ini, dan masa depan.\r\nKisah kelam yang saya maksud adalah, saat nenek moyang kita pernah jadi pemburu kepala manusia. Dan, perilaku ini menyebar dari Barat hingga Timur, dari Aceh hingga Papua. Demikian uraiannya.""}",127.0.0.1,"Mozilla/5.0 (X11; Linux x86_64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/33.0.1750.146 Safari/537.36",,1,,"2014-05-05 13:33:33",admin
